import React from "react";
import { CssBaseline } from '@material-ui/core';
import { createMuiTheme, ThemeProvider } from "@material-ui/core/styles";
import './Theme.css'

const theme = createMuiTheme({
  typography: {
    fontFamily: [
      'Fira Sans',
      'Roboto',
      '-apple-system',
      'BlinkMacSystemFont',
      '"Segoe UI"',
      '"Helvetica Neue"',
      'Arial',
      'sans-serif',
      '"Apple Color Emoji"',
      '"Segoe UI Emoji"',
      '"Segoe UI Symbol"',
    ].join(','),
    fontWeightRegular: '500',
  },
  palette: {
    primary: {
        main: '#124b73'
    },
    secondary: {
      main: '#dfdfdf'
    },
    text :{
      primary: "#000",
      secondary: "#fff",
    },
  },
  overrides:{
      MuiButton:{
        root:{
          background: '124b73'
        }
      }
  }
});

export default function({ children }) {
  return <ThemeProvider theme={theme}>
    <CssBaseline />
    {children}
    </ThemeProvider>;
}
